import React from 'react';
import { Link } from "react-router-dom"
import BootstrapCard from 'react-bootstrap/Card';




export const Card = ({ listTodos }) => {
    return(
        <>
            {listTodos.map(todo => {
                return(
                    <BootstrapCard>
                        <ul key={todo.id}>
                            <li>
                                <BootstrapCard body><Link to={`${todo.id}`}>{todo.content}</Link></BootstrapCard>
                            </li>
                        </ul>
                    </BootstrapCard>
                )
            })}
        </>
    )
}
